import React from "react";

function MainBottom(props) {
    return (
        <div className="main_bttom">
            <div>
                {props.players_number}
                <div className="circular"></div>
            </div>
            <div>Winner</div>
            <div>Dice</div>
            
        </div>
        
    );
}

export default MainBottom;
